import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
  pageContent: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    maxWidth: 1120,
    marginHorizontal: 'auto',
    padding: 40
  }
});
